    <meta charset="utf-8">
    <style type="text/css">
        .center {
            max-width: 100%;
            max-height: 100%;
            display: block;
            margin: auto auto;
            vertical-align: middle;
        }

        html, body {
            overflow: hidden;
            width   : 100%;
            height  : 100%;
            margin  : 0;
            padding : 0;
			position: fixed;
            display: flex;
        }
        .parent {
            margin: auto;
            background-color: #000;
            display: flex;
            height: 100%;
            width: 100%;
        }
        .centered {
            position: absolute;
            top: 50%;
            left: 50%;
            width   : 80%;
            height  : 80%;
            transform: translate(-50%, -50%);
            z-index: 100;
        }
		video{
			position:absolute; 
			padding: 0;
			margin: 0;
            top: 50%;
            left: 50%;
			object-fit: cover;
			z-index: 10;
			height:100vh;
			width: auto;
            transform: translate(-50%, -50%);
			display:none;
		}
		video::-webkit-media-controls {
			display: none !important; 
		}				
		canvas {
            top: 50%;
			left: 50%;
			-webkit-transform: translate(-50%, -50%);
			position:absolute; 
			z-index: 111;
		}
		#icon {
            top: 10px;
			left: 10px;
			-webkit-transform: scale(0.4);
			transform: scale(0.4);
			transform-origin: left top;
			backface-visibility: hidden;
			position:absolute; 
			z-index: 500;
		}
		#scope{    
			left: 50%;
			top: 50%;
			-webkit-transform: translate(-50%, -50%);
			animation-name: scope-anim-reverse;
			animation-duration: 7s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			z-index: 112;
		}
		@keyframes scope-anim-reverse {
			0%   {transform:translate(0%,50%);}
			20%   {transform:translate(180%,120%);}
			40%   {transform:translate(-50%,150%);}
			60%   {transform:translate(180%,120%);}
			80%   {transform:translate(130%,150%);}
			100%   { transform:translate(0%,50%);}
		}
		 .btn {
			position: absolute;
			width:200px;
			z-index:200;
			padding: 0.7em 2.1em 0.8em;
			border-radius: 10px;
			margin: 8px 8px 8px 8px;
			animation-name: btn-anim-reverse;
			animation-duration: 0.5s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			left: 50%;
			top: 90%;
			-webkit-transform: translate(-50%, -50%);
			color: #fbdedb;
			font-family: sans-serif;
			font-weight: 800;
			font-size: 1.2em;
			text-transform: uppercase;
			text-align: center;
			text-decoration: none;
			-webkit-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			-moz-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			
		}
		.btn2 {
			position: absolute;
			width:100px;
			z-index:200;
			padding: 0.8em 1em 1em;
			border-radius: 10px;
			margin: 8px 8px 8px 8px;
			animation-name: btn-anim-reverse;
			animation-duration: 0.5s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			left: 80%;
			top: 5%;
			-webkit-transform: translate(-50%, -50%);
			color: #fbdedb;
			font-family: sans-serif;
			font-weight: 800;
			font-size: 0.8em;
			text-transform: uppercase;
			text-align: center;
			text-decoration: none;
			-webkit-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			-moz-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
		}
		@keyframes btn-anim-reverse {
			0% {
				-webkit-transform: translate(-50%, -50%);
			}
			50% {
				-webkit-transform: translate(-50%, -60%);
			}
			100% {
				-webkit-transform: translate(-50%, -50%);
			}
		}
		.btn:hover, .btn:focus {
			opacity: 0.8;
		}
		.btn:active {
			-webkit-transform: scale(0.80);
			-moz-transform: scale(0.80);
			-ms-transform: scale(0.80);
			-o-transform: scale(0.80);
			transform: scale(0.80);
		}
		.btn.block {
			display: block !important;
		}

		.red {
			background-color: #d55050;
		}
		.disable-select {
			user-select: none; /* supported by Chrome and Opera */
		   -webkit-user-select: none; /* Safari */
		   -khtml-user-select: none; /* Konqueror HTML */
		   -moz-user-select: none; /* Firefox */
		   -ms-user-select: none; /* Internet Explorer/Edge */
		}
    </style>


<script charset="utf-8">
	var state = 0;
	var installNow = false;
	var redirectLink;

	var currOrient = "";
	window.oncontextmenu = function(event) {
		 event.preventDefault();
		 event.stopPropagation();
		 return false;
	};
	window.onresize = function(event) {
		handleSize();
	};
	function gameSettings(){
		if (/android/i.test(navigator.userAgent)) redirectLink = 'https://play.google.com/store/apps/details?id=com.funvai.jseasniper';
		else if(/iPad|iPhone|iPod/.test(navigator.userAgent)) redirectLink = 'https://apps.apple.com/us/app/jurassic-sniper-3d/id1535441769';
		else redirectLink = 'https://play.google.com/store/apps/details?id=com.funvai.jseasniper';
	}
	
	if (window.mraid) mraid.addEventListener("orientationchange", Orientation);  
	else window.addEventListener("orientationchange", function(event) {
		  console.log("the orientation of the device is now " + event.target.screen.orientation.angle);
		  handleSize();
		});
	
	function handleSize(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');
		var canvasSource = document.getElementById('gameCanvas');
		
		if(window.innerWidth < window.innerHeight){
			var btn = document.getElementById("btn");
			
				btn.style.top = 5+"%";
				btn.style.left = 80+"%";
				btn.style.width = 100+"px";
				if(window.innerWidth<=350)
				{
					btn.style.width = 70+"px";
				}
			
		}
		else {
			var btn = document.getElementById("btn");
			
				btn.style.top = 10+"%";
				btn.style.left = 85+"%";
				btn.style.width = 100+"px";
			
		}
	}
	function resetCSS(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');

		vid.style.paddingTop        = 0;
		vid.style.paddingBottom     = 0;
		vid.style.paddingLeft       = 0;
		vid.style.paddingRight      = 0;
		vid.style.height            = "100%";
		vid.style.width             = "100%";
	}
</script>
<script>
	var initTime = new Date().getTime();
	var gameover=0, gameTimeout;

	function clickthrough(event){
		event.preventDefault();
		
		if(gameover!=1){
			var newTime = new Date().getTime();
			gameover=1;
			//if(newTime >= initTime+500)
			//{
			initTime = new Date().getTime();
			console.log("state 00: "+initTime);
			console.log("state val: "+state);
			missedStart=0;
			
			var vid = document.getElementById('gifimage2');
			vid.currentTime = 0;
			vid.play();
			vid.style.visibility = 'visible';
			document.getElementById("btn").className = "btn2 red";
			handleSize();
			state++;
			
			if(gameTimeout) clearTimeout(gameTimeout);
			gameTimeout = setTimeout(function(){
				vid.style.visibility = 'hidden';
				vid.currentTime = 0;
				vid.pause();
				gameover=0;
				document.getElementById("btn").className = "btn2 red";
				handleSize();
			},2700);
			//}
		}
		if(state==1)
		{			
			var btn = document.getElementById("btn");
			btn.className = "btn2 red";
			btn.style.opacity=1;
			btn.style.zIndex = 200;
		}
	}
	
	function btnevent(event){
		event.preventDefault();
		console.log("redir");
		if (window.mraid) {
			mraid.open(redirectLink);
		} else {
			location.href = redirectLink;
		}
	}
</script>

<body>

		mraid.addEventListener('viewableChange', viewableChangeHandler);
			// The isViewable method returns whether the ad container is viewable on the screen.
			if (mraid.isViewable()) {
				showMyAd(); 
			}
		};
		"loading" === window.mraid.getState() ? (window.mraid.addEventListener("ready", b), console.log("loading mraid")) : (b(), console.log("ready mraid"));

	function showMyAd() {
		gameSettings();
		handleSize();
	}

	function onBlur() {
		console.log("lefttab");
		sound.pause();
	};
	function onFocus(){
		vidSource.play();
		console.log("came back");
		sound.play();
	};
	
	if(!window.mraid){	
		if (/*@cc_on!@*/false) { // check for Internet Explorer
			document.onfocusin = onFocus;
			document.onfocusout = onBlur;
		} else {
			window.onfocus = onFocus;
			window.onblur = onBlur;
		}
	}
	function viewableChangeHandler(viewable) {
		if(viewable) {
			// If the ad is viewable, show the ad:
			onFocus(); 
		} else {
			// If not, pause the ad.
			onBlur();
		}
	}
